import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import Sidebar from "./components/Sidebar";
import {
    BrowserRouter as Router,
    Route,
    Link
  } from 'react-router-dom'
function App() {
    return(
        <Router>
        <div className="app">
            <Navbar />
            <Sidebar />
        </div> 
        </Router>
    )
}

export default App;
